// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import breakpoints from "assets/theme/base/breakpoints";
// Vision UI Dashboard PRO React base styles
import typography from "assets/theme/base/typography";
// Vision UI Dashboard PRO React components
import VuiBox from "components/VuiBox";
import VuiTypography from "components/VuiTypography";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";
import Footer from "examples/FooterXLH";
import Globe from "examples/Globe";
// Vision UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";


// icons
import { FaShoppingCart } from "react-icons/fa";
import { BsGlobe } from "react-icons/bs";
import { IoWallet, IoDocumentText } from "react-icons/io5";

import TeamProfileCard from "examples/Cards/TeamCards/TeamProfileCard2";

function Default() {
  const { values } = breakpoints;

  return (    
      <VuiBox py={3}>
        <Grid container>
          <Grid item xs={12} lg={7}>
            <VuiBox mb={3} p={1}>
              <VuiTypography
                variant={window.innerWidth < values.sm ? "h3" : "h2"}
                textTransform="capitalize"
                fontWeight="bold"
                color="white"
              >
                Staking
              </VuiTypography>
            </VuiBox>
            <Grid container>
              <Grid item xs={12}>
                <Globe
                  display={{ xs: "none", md: "block" }}
                  position="absolute"
                  top="10%"
                  right={0}
                  mt={{ xs: -12, lg: 1 }}
                  mr={{ xs: 0, md: -10, lg: 10 }}
                  canvasStyle={{ marginTop: "3rem" }}
                />
              </Grid>
            </Grid>
          </Grid>
          <Grid item xs={12} lg={12}>
            <VuiBox mb={3}>
              <TeamProfileCard
                  title="Instant Mode"
                  description="You can claim the rewards anytime, no waiting time - small APY"
                  total="100.000 XLH"
                  apy="2%"
                  amount={true}
                  holders={12}
              />
            </VuiBox>
          </Grid>  
          <Grid item xs={12} lg={12}>
            <VuiBox mb={3}>
              <TeamProfileCard
                  title="Investment Mode"
                  description="You can claim better rewards after a period of 60 days, moderate waiting time - moderate APY"
                  total="100.000 XLH"
                  apy="6%"
                  amount={true}
                  holders={59}
              />
            </VuiBox>
          </Grid>   
          <Grid item xs={12} lg={12}>
            <VuiBox mb={3}>
              <TeamProfileCard
                  title="Expert Mode"
                  description="You can claim the best rewards after a period of 120 days, longer waiting time - great APY"
                  total="100.000 XLH"
                  apy="10%"
                  amount={true}
                  holders={59}
              />
            </VuiBox>
          </Grid>  
        </Grid>       
      </VuiBox>
  );
}

export default Default;
